import React from 'react';
import Box4 from './Box4';



const style = {display:'flex' , flexDirection:'column' , justifyContent:'space-around', textAlign:'center', backgroundColor: 'pink', width: '600px' , height:'300px' };
const Box3 = () => {
  return (
		<div className="box3" style={style}>
    	<Box4 />
			<Box4 />
		</div>

  );
};

export default Box3;
